import { useState } from "react";
import axios from "axios";

const GetCandidate = () => {
  const [getCandidate, setGetCandidate] = useState([]);
  axios({
    method: "get",
    url: "http://localhost:3001/get-candidate",
    responseType: "json",
  }).then((response) => {
    setGetCandidate(response.data.data);
  });
};

export { GetCandidate };
